import Link from 'next/link';
import styled from 'styled-components';

const Title = styled.h2`
    color: black;
`;
const ATag = styled.a`
    margin-right: 60px;
`;
const HeaderContainer = styled.header`
    padding: 0px 20px;
`;

const Header = props => (
    <HeaderContainer>
        <Title>{props.children}</Title>
        <Link href="/">
            <ATag>Home</ATag>
        </Link>
        <Link href="/schedules">
            <ATag>Schedules</ATag>
        </Link>
        {/* <Link href="/today">
            <a style={linkStyle}>Today</a>
        </Link> */}
        <Link href="/about">
            <ATag>About</ATag>
        </Link>
    </HeaderContainer>
);

export default Header;
